    -- (and hope it doesn't fail!)
    DELETE FROM sysdiagrams WHERE diagram_id = @newid
    PRINT 'XxXxX ' + Error_Message() + ' XxXxX'
    PRINT 'XxXxX END Tool_ScriptDiagram2008 - fix the error before running again XxXxX'
    RETURN
END CATCH
GO
